import React from "react";
import SeatItem from "../SeatItem";
import "./ListSeat.scss";
function ListSeat(props) {
  // console.log(props.listSeat);
  let { listSeat } = props;
  console.log(listSeat);
  let row = listSeat.length / 16;
  function getListSeat() {
    let arrWItem = [];
    for (let i = 1; i <= row; i++) {
      let arrItem = [];
      arrItem.push(
        <span
          className="seat__wrapper"
          key={"row_" + String.fromCharCode(64 + i)}
        >
          <span className="seat__item"> {String.fromCharCode(64 + i)}</span>
        </span>
      );
      for (let j = (i - 1) * 16; j < i * 16; j++) {
        arrItem.push(
          <SeatItem
            seatItem={listSeat[j]}
            key={j + "key"}
            code={String.fromCharCode(64 + i)}
          />
        );
        if (j % 8 === 7 && j % 16 !== 15) {
          arrItem.push(
            <span className="seat__wrapper" key={j + "space"}></span>
          );
        }
        if (j % 8 === 1 && j % 16 === 12) {
          arrItem.push(
            <span className="seat__wrapper" key={j + "space"}></span>
          );
        }
        // if (j % 8 === 1 && j % 16 !== 9) {
        //   arrItem.push(
        //     <span className="seat__wrapper" key={j + "space"}></span>
        //   );
        // }
      }
      arrWItem.push(
        <React.Fragment>
          <div className="rowSeat" key={i + "space"}>
            {arrItem}
          </div>
        </React.Fragment>
      );
    }
    return arrWItem;
  }
  return (
    <div className="listSeat">
      <div className="autoCenter">
        <div>{getListSeat()}</div>
      </div>
    </div>
  );
}

export default ListSeat;
